import BarChart from "../components/Charts/BarChart";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";

const DashboardPage = () => {
	return (
		<>
			<Grid
				item
				xs={12}
				sm={8}
				md={6}
				lg={6}
				component={Paper}
				elevation={6}
				square
			>
				<BarChart></BarChart>
			</Grid>
		</>
	);
};

export default DashboardPage;
